  [],\n\t\"revision_timestamp\": \"2015-09-27T01:59:23.283601\",\n\t\"name\": \"nwfsc-groundfish-data-for-u-s-west-coast-2003-2005\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The data available for downloading is summarized
  data from the 2003-2005nU.S. West Coast Bottom Trawl Survey (WCGTS) of Groundfish
  Resources offnWashington, Oregon and California.nnThe Northwest Fisheries Science
  Center's Fishery Resource Analysis andnMonitoring Division (FRAM) completed the
  sixth in an annual series ofngroundfish bottom trawl surveys in 2003. The survey
  was conducted Junen24 to October 23, 2003 and targeted the commercial groundfish
  resourcesninhabiting depths of 55 to 1,280 meters [m], (30 - 700 fathoms [fm])nfrom
  the area off Cape Flattery, Washington (latitude [lat.] 48u00b010'N)nto the U.S.-Mexican
  border (lat. 32u00b030'N) using chartered West Coastncommercial trawlers. These
  ongoing series of annual surveys, conductednby FRAM since 1998, are designed to
  monitor long-term trends inndistribution and abundance of west coast groundfish,
  especially thosenspecies of management concern. The 2003 survey represents the firstnyear
  in which the depth range was expanded to include both thencontinental shelf (55
  - 183 m) and continental slope (183 - 1,280 m)narea and the first year in which
  a stratified-random sampling designnwas adopted.nnIn 2003, a total of 574 successful
  tows were completed out of 643nattempts. Simrad ITI net mensuration data, as well
  as globalnpositioning system (GPS) navigation data and bottom contact sensorndata,
  used to document performance (e.g. bottom tending), werenobtained for most tows.nnAn
  Aberdeen-style net with a small mesh (2\" stretched measure or less)nliner in the
  codend (to retain smaller specimens) was used to samplenfish biomass.  Target duration
  of each tow was 15 minutes. Townduration was the time between touchdown and lift-off
  of the trawl netnfrom the seafloor based on readings from bottom contact sensors.nnCatches
  were sorted to species, aggregate or other appropriatentaxonomic level and then
  weighed using an electronic,nmotion-compensated scale.  A total of 517 species or
  families (fishnand invertebrates) were identified within the survey area. Althoughnbiological
  sampling effort continues to include Dover solen(Microstomus pacificus), shortspine
  thornyhead (Sebastolobusnalascanus), longspine thornyhead (Sebastolobus altivelis),
  andnsablefish (Anoplopoma fimbria), focus has increasingly shifted tonencompass
  all groundfish species of management concern. Up to 100nlength measurements, sex
  determinations, and individual weightsnand up to 25 age structures were collected
  per haul for these species.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
